# endereco fim do cenario 0x10010000 + 65536

# VETORES COM PARAMETROS DOS PERSONAGENS

# Ordem dos parametros do vetor:
# base, altura, x inicial, y inicial, x final, y, final, offset inicio, variavel

# vetor 1: endereco 0x10010000 + 66776
.word 10 11 58 50 100 10 65536 15 
# vetor 2: endereco 0x10010000 + 66808
.word 10 10 40 20 40 40 65976 20 
# vetor 3: endereco 0x10010000 + 66840
.word 10 10 75 25 80 50 66376 25

.text 

main:

# Parametros globais:
	
	addi $25 $0 128 # quantidade de colunas do cenario
	addi $30 $0 64 # quantidade de linhas do cenario
	mul $26 $25 $30 # area do cenario
	addi $27 $0 334 # assets + vetor 
	addi $6 $0 512 # width do display
	addi $7 $0 4 # porporcao width do display
	
# Chamada de funcao para guardar cenario, personagens e vetores na memoria
	add $10, $27, $26 # contador da iteracao
	add $8 $0 $10
	sll $8 $8 2
	addi $8 $8 0x10010000
	addi $8 $8 -4 # local a ser lido
	add $24 $0 $10
	sll $24 $24 2
	add $24 $24 $8 
	sll $1 $27 2
	sub $24 $24 $1 # local a ser armazenado
	jal store
	
# Chamada de funcao para carregar cenario na tela
	lui $8, 0x1001 # local a ser escrito
	add $24 $0 $26
	sll $24 $24 2
	add $24 $24 $8 # local a ser lido
	addi $10, $0, 0 # contador
	jal load
	
# Ponteiros para vetores dos personagens 
	lui $2 0x1001
	addi $1 $0 66776 # personagem1[0]
	add $2 $2 $1
	
	lui $3 0x1001
	addi $1 $0 66808 # personagem2[0]
	add $3 $3 $1
	
	lui $4 0x1001
	addi $1 $0 66840 # personagem3[0]
	add $4 $4 $1
	
# loop da animacao da tela:
	# desenha todos personagens
	# aguarda um tempo
	# apaga todos os personagens 
	# controla movimento dos personagens
animacao:
	bne  $0, $0, fimanimacao # comparacao de posicao
	
# carregamento de parametros do personagem 1: protagonista
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # inicio 
	lw $29 28($2) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 2: npc
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # inicio
	lw $29 28($3) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 3: npc
	lw $22 0($4) # base  
	lw $23 4($4) # altura 
	lw $18 8($4) # x inicial
	lw $19 12($4) # y inicial
	lw $20 16($4) # x final
	lw $21 20($4) # y final
	lw $28 24($4) # inicio
	lw $29 28($4) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# tempo de espera da animacao
	addi $8, $0, 6000 # taxa de tempo de espera
	jal timer
	
# apagar persoangens da tela
pers1:	

# carregamento de parametros do personagem 1: protagonista
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # inicio
	lw $29 28($2) # extra

# chamada de funcao para apagar personagem
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	

# controle manual de personagem:	
controle:
	lui $8, 0xffff # tecla foi digitada
	lw $11, 0($8)
	beq $11, $0, naodig # se != 0 digitou algo
	addi $12, $0, 'd'
	lw $13, 4($8) # tecla digitada pelo usuario
	beq $12, $13, dir # se for d 
	addi $12, $0, 'a'
	beq $12, $13, esq # se for a
	addi $12, $0, 's'
	beq $12, $13, baixo # se for s
	addi $12, $0, 'w'
	beq $12, $13, cima # se for w 
	addi $12, $0, ' '
	beq $12, $13, end # se for ' '

	j naodig
	
# caso queira alterar a velocidade do movimento aumente os valores
dir:  	
	addi $18, $18, 1 # incrementa endereco pra direita
	j naodig
esq: 	
	addi $18, $18, -1 # incrementa endereco pra esquerda
	j naodig
baixo: 	
	addi $19, $19, 1 # incrementa endereco pra baixo 
	j naodig
cima:	
	addi $19, $19, -1 # incrementa endereco pra cima
	j naodig
	
naodig:
	# aqui pode-se fazer algo quando no h entrada de teclas

	
# continua para o proximo personagem
fimpers1:
	
# armazenamento de parametros do personagem 1: protagonista
	sw $22 0($2) # base  
	sw $23 4($2) # altura 
	sw $18 8($2) # x inicial
	sw $19 12($2) # y inicial
	sw $20 16($2) # x final
	sw $21 20($2) # y final
	sw $28 24($2) # inicio
	sw $29 28($2) # extra
	
pers2:

# carregamento de parametros de personagem 2: npc
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # inicio
	lw $29 28($3) # extra
	
# chamada de funcao para apagar personagem
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	
# controle automatico de movimento de personagem
ida2:	beq $19, $21 troca2 # troca x inicial e final
	bgt $19, $21 volta2 # loop da ida
	addi $19, $19, 1 # variacao do movimento
	j fimpers2
troca2:
	add $21 $0 $29 # x final = x inicial
	add $29 $0 $19 # extra = x final
	j fimpers2
volta2:	
	blt $19 $21 ida2 # loop da volta
	addi $19, $19, -1 # variacao do movimento
fimpers2:
	
# armazenamento de parametros do personagem 2: npc
	sw $22 0($3) # base  
	sw $23 4($3) # altura 
